// FAQ.js

import React from 'react';
import '../styles/FAQ.css'; // You will create this CSS file

function FAQ() {
    return (
    <div className="faq-page">
        <h1>Frequently Asked Questions (FAQ)</h1>
        <section className="faq-section">
            {/* Insert your FAQ content here */}
            <article className="faq-article">
                <h2>What programs can I apply for?</h2>
                <p>You can apply for a variety of programs including...</p>
            </article>
            {/* Repeat for other FAQs */}
        </section>
        <a href="/" className="back-to-main">Back to Main Page</a>
    </div>
    );
}

export default FAQ;
